import React from "react";
import arr from "./all/50.mp4";
import "./App.css";
import ReactPlayer from "react-player";

const App = () => {
  return (
    <div className="video">
              <ReactPlayer  url={arr}  loop muted playing></ReactPlayer>
    </div>
  );
};

export default App;
